*Eucalyptus Version*

{{4.3.1-0.25169.83.20161207gitc6e1435.el7}}

*Euca2ools Version*

{{3.3.1-0.1839.51.20161208gita195aac.el7}}

*Steps*

# Set up Eucalyptus 4.3.1 cloud with VPC - [hspencer-207|http://jenkins.qa1.eucalyptus-systems.com/job/Quick%20Launch%20Maint-4.3/207/]
# Created non-eucalyptus account
{code}
[root@d-14 ~]# euare-accountcreate -a sales
{code}
# Add the linked {{cfn-stack-limit.json}} quota to the sales account
{code}
[root@d-14 ~]# euare-accountuploadpolicy -p cfn-stack-limit -f cfn-stack-limit.json -a sales
{code}
# Listed stack using {{\-v}} option:
{code}
[root@d-14 ~]# euare-accountlistpolicies -a sales -v
cfn-stack-limit
{
 "Statement": [
   {
     "Action": ["*" ],
     "Effect": "Limit",
     "Resource": "*",
     "Condition": { "NumericLessThanEquals":{"cloudformation:quota-stacknumber": "3"}}
   }
 ]
}

{code}
